import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Contact from './components/Contact'
import { Switch , Route, Router} from 'react-router-dom';


function App() {
  return (
    <>
      <Navbar />
      <Router>
      <Route path='/' exact>
        <Home/>
        <Contact />
      </Route>
      </Router>
    </>
  );
}

export default App;
